
CREATE SEQUENCE aluno_seq;

CREATE TABLE IF NOT EXISTS aluno (
  aluno_id int NOT NULL DEFAULT NEXTVAL ('aluno_seq'),
  nome varchar(300) DEFAULT NULL,
  sexo char(1) DEFAULT NULL,
  data_nascimento date DEFAULT NULL,
  avatar bytea,
  endereco varchar(50) DEFAULT NULL,
  numero_endereco int DEFAULT NULL,
  cep varchar(50) DEFAULT NULL,
  bairro varchar(50) DEFAULT NULL,
  cidade varchar(50) DEFAULT NULL,
  estado varchar(50) DEFAULT NULL,
  descricao varchar(4000) DEFAULT NULL,
  PRIMARY KEY (aluno_id)
)  ;

ALTER SEQUENCE aluno_seq RESTART WITH 29;


CREATE SEQUENCE escolaridade_seq;

CREATE TABLE IF NOT EXISTS escolaridade (
  escolaridade_id int NOT NULL DEFAULT NEXTVAL ('escolaridade_seq'),
  nome varchar(200) NOT NULL DEFAULT '',
  PRIMARY KEY (escolaridade_id)
)  ;

ALTER SEQUENCE escolaridade_seq RESTART WITH 5;


CREATE SEQUENCE professor_seq;

CREATE TABLE IF NOT EXISTS professor (
  professor_id int NOT NULL DEFAULT NEXTVAL ('professor_seq'),
  nome varchar(300) NOT NULL,
  data_nascimento date NOT NULL,
  escolaridade_id int NOT NULL,
  PRIMARY KEY (professor_id)
 ,
  CONSTRAINT FK_professor_escolaridade FOREIGN KEY (escolaridade_id) REFERENCES escolaridade (escolaridade_id)
)  ;

ALTER SEQUENCE professor_seq RESTART WITH 7;

CREATE INDEX FK_professor_escolaridade ON professor (escolaridade_id);

CREATE SEQUENCE disciplina_seq;

CREATE TABLE IF NOT EXISTS disciplina (
  disciplina_id int NOT NULL DEFAULT NEXTVAL ('disciplina_seq'),
  nome varchar(300) DEFAULT NULL,
  descricao varchar(4000) DEFAULT NULL,
  cor varchar(50) DEFAULT NULL,
  carga_horaria smallint DEFAULT NULL,
  PRIMARY KEY (disciplina_id)
)  ;

ALTER SEQUENCE disciplina_seq RESTART WITH 10;

CREATE INDEX disciplina_id ON disciplina (disciplina_id);


-- Copiando estrutura para tabela escola.turma
CREATE SEQUENCE turma_seq;

CREATE TABLE IF NOT EXISTS turma (
  turma_id int NOT NULL DEFAULT NEXTVAL ('turma_seq'),
  disciplina_id int DEFAULT NULL,
  professor_id int DEFAULT NULL,
  data_inicio date DEFAULT NULL,
  data_fim date DEFAULT NULL,
  ano_letivo int DEFAULT NULL,
  PRIMARY KEY (turma_id) ,
  CONSTRAINT FK_turma_disciplina FOREIGN KEY (disciplina_id) REFERENCES disciplina (disciplina_id),
  CONSTRAINT FK_turma_professor FOREIGN KEY (professor_id) REFERENCES professor (professor_id)
)  ;

ALTER SEQUENCE turma_seq RESTART WITH 10;

CREATE INDEX turma_id ON turma (turma_id);
CREATE INDEX FK_turma_disciplina ON turma (disciplina_id);
CREATE INDEX FK_turma_professor ON turma (professor_id);


-- Copiando estrutura para tabela escola.aluno_turma
CREATE SEQUENCE aluno_turma_seq;

CREATE TABLE IF NOT EXISTS aluno_turma (
  aluno_turma_id int NOT NULL DEFAULT NEXTVAL ('aluno_turma_seq'),
  aluno_id int DEFAULT NULL,
  turma_id int DEFAULT NULL,
  nota double precision DEFAULT NULL,
  qtd_faltas int DEFAULT NULL,
  codigo_validacao varchar(100) DEFAULT NULL,
  PRIMARY KEY (aluno_turma_id) ,
  CONSTRAINT aluno_id_turma_id UNIQUE  (aluno_id,turma_id)
 ,
  CONSTRAINT FK_aluno_turma_aluno FOREIGN KEY (aluno_id) REFERENCES aluno (aluno_id),
  CONSTRAINT FK_aluno_turma_turma FOREIGN KEY (turma_id) REFERENCES turma (turma_id)
)  ;

ALTER SEQUENCE aluno_turma_seq RESTART WITH 301;

CREATE INDEX aluno_turma_id ON aluno_turma (aluno_turma_id);
CREATE INDEX FK_aluno_turma_turma ON aluno_turma (turma_id);




