INSERT INTO disciplina VALUES (1, 'Português', 'A <b>língua portuguesa</b>, também designada português, é uma língua românica flexiva ocidental originada no galego-português falado no Reino da Galiza e no norte de Portugal. Com a criação do Reino de Portugal em 1139 e a expansão para o sul como parte da Reconquista deu-se a difusão da língua pelas terras conquistadas e mais tarde, com as descobertas portuguesas, para o Brasil, África e outras partes do mundo.[3] O português foi usado, naquela época, não somente nas cidades conquistadas pelos portugueses, mas também por muitos governantes locais nos seus contatos com outros estrangeiros poderosos. Especialmente nessa altura a língua portuguesa também influenciou várias línguas.', '', 40);
INSERT INTO disciplina VALUES (2, 'Matemática', 'A <b>matemática</b> é a ciência do raciocínio lógico e abstrato, que estuda quantidades, medidas, espaços, estruturas, variações e estatísticas. Um trabalho matemático consiste em procurar por padrões, formular conjecturas e, por meio de deduções rigorosas a partir de axiomas e definições, estabelecer novos resultados. A matemática desenvolveu-se principalmente na Mesopotâmia, no Egito, na Grécia, na Índia e no Oriente Médio. A partir da Renascença, o desenvolvimento da matemática intensificou-se na Europa, quando novas descobertas científicas levaram a um crescimento acelerado que dura até os dias de hoje', NULL, 20);
INSERT INTO disciplina VALUES (3, 'Física', '<b>Física</b> é a ciência que estuda a natureza e seus fenômenos em seus aspectos mais gerais. Analisa suas relações e propriedades, além de descrever e explicar a maior parte de suas consequências. Busca a compreensão científica dos comportamentos naturais e gerais do mundo em nosso torno, desde as partículas elementares até o universo como um todo.[1][2] Com o amparo do método científico e da lógica, e tendo a matemática como linguagem natural, esta ciência descreve a natureza através de modelos científicos. É considerada a ciência fundamental, sinônimo de ciência natural: as ciências naturais, como a química e a biologia, têm raízes na física. Sua presença no cotidiano é muito ampla, sendo praticamente impossível uma completíssima descrição dos fenômenos físicos em nossa volta. A aplicação da física para o benefício humano contribuiu de uma forma inestimável para o desenvolvimento de toda a tecnologia moderna, desde o automóvel até os computadores quânticos.', NULL, 120);
INSERT INTO disciplina VALUES (4, 'Química', 'Química é a ciência que estuda a composição, estrutura, propriedades da matéria, as mudanças sofridas por ela durante as reações químicas e a sua relação com a energia.[2][3]. É considerada uma ciência exata e é chamada muitas vezes de ciência central porque é a ponte entre outras ciências naturais[4][nota 2] como Física, Matemática e Biologia. A Química possui papel fundamental no desenvolvimento tecnológico, pois a utilização dos conceitos e técnicas dessa ciência permite a obtenção de novas substâncias, além de preocupar-se com a prevenção de danos e exploração sustentável do meio ambiente.', NULL, 30);
INSERT INTO disciplina VALUES (5, 'Biologia', 'Biologia é a ciência que estuda a vida e os organismos vivos.[1][2] A biologia está dividida em vários campos especializados que abrangem a morfologia, fisiologia, anatomia, comportamento, origem, evolução[2][3] e distribuição da matéria viva, além dos processos vitais e das relações entre os seres vivos.[1][4] As subdisciplinas da biologia são definidas pela escala em que a vida é estudada, os tipos de organismos estudados e os métodos utilizados para estudá-los: a bioquímica examina a química rudimentar da vida; a biologia molecular estuda as interações complexas entre as moléculas biológicas; a biologia celular examina o bloco básico de construção de toda a vida, a célula; a fisiologia examina as funções físicas e químicas dos tecidos, órgãos e sistemas de órgãos; a ecologia examina como os organismos interagem em seu ambiente; e a biologia evolutiva examina os processos evolutivos que provavelmente produziram a diversidade da vida.[5] Apesar do amplo escopo e da complexidade da ciência, existem certos conceitos unificadores que o consolidam em um único campo coerente. Geralmente, a biologia reconhece a célula como a unidade básica da vida, os genes como a unidade básica da hereditariedade, e a evolução como o motor que impulsiona a criação de novas espécies.', NULL, 20);
INSERT INTO disciplina VALUES (6, 'Geografia', 'A Geografia é uma ciência que tem por objetivo o estudo da superfície terrestre e a distribuição espacial de fenômenos significativos na paisagem. Também estuda a relação recíproca entre o homem e o meio ambiente (Geografia Humana). Para alguns a Geografia também pode ser uma prática humana de conhecer onde se vive para compreender e planejar o espaço onde se vive. Um dos temas centrais da geografia é a relação homem-natureza. A natureza é entendida aqui como as forças que geraram ou contribuem para moldar o espaço geográfico, isto é, a dinâmica e interações que existem entre a atmosfera, litosfera, hidrosfera e biosfera. O homem é entendido como um organismo capaz de modificar consideravelmente as forças da natureza através da tecnologia..', NULL, 50);
INSERT INTO disciplina VALUES (7, 'História', 'História é a ciência que estuda o ser humano e sua ação no tempo e no espaço concomitantemente à análise de processos e eventos ocorridos no passado. O termo "História" também pode significar toda a informação do passado arquivada em todas as línguas por todo o mundo, por intermédio de registos históricos.', NULL, 20);
INSERT INTO disciplina VALUES (8, 'Educação Física', 'Educação física é uma área do conhecimento humano ligada às práticas corporais historicamente produzidas pela humanidade. A educação física é o processo pedagógico que visa à formação do homem capaz de se conduzir plenamente em suas atividades. Trabalha num sentido amplo, visando à prevenção de determinadas doenças.', NULL, 100);
INSERT INTO disciplina VALUES (9, 'Filosofia', 'Filosofia é o estudo de questões gerais e fundamentais[5][6][7] sobre a existência, conhecimento, valores, razão, mente, e linguagem; frequentemente colocadas como problemas[8][9] a se resolver. O termo provavelmente foi cunhado por Pitágoras (c. 570  495 BCE). Os métodos filosóficos incluem o questionamento, a discussão crítica, o argumento racional e a apresentação sistemática.[10] As questões filosóficas clássicas incluem: É possível saber qualquer coisa e provar que se sabe?[11][12][13] O que é mais real? Os filósofos também colocam questões mais práticas e concretas, como: Existe uma maneira melhor de se viver? É melhor ser justo ou injusto (se haver como se safar)? Os seres humanos têm livre arbítrio?', NULL, 40);
